package com.imooc;

public class FloatDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		float f=1234.328f;
		System.out.println("f="+f);
		double d=7399.3;
		System.out.println("d="+d);
		double d1=123L;
		System.out.println("d1="+d1);
		double d2=d;
		System.out.println("d2="+d2);
	}

}
